<script>
// اجرای این کد هنگامی که صفحه بارگذاری شود
document.addEventListener("DOMContentLoaded", function() {
    // یافتن دکمه ورود
    var loginButton = document.querySelector('.submit-btn');

    // یافتن تمام ورودی‌های کد عاملی
    var otpInputs = document.querySelectorAll('.otp-item input');

    // اضافه کردن رویداد بررسی به ورودی‌های کد عاملی
    otpInputs.forEach(function(input) {
        input.addEventListener('input', function() {
            // بررسی وضعیت تمام ورودی‌های کد عاملی
            var allEmpty = true;
            otpInputs.forEach(function(input) {
                if (input.value.trim() !== '') {
                    allEmpty = false;
                }
            });

            // اگر تمام ورودی‌ها خالی نباشند، دکمه ورود را فعال کنید
            if (!allEmpty) {
                loginButton.removeAttribute('disabled');
            } else {
                loginButton.setAttribute('disabled', 'disabled');
            }
        });
    });

    // بررسی اولیه همراه با بارگذاری صفحه
    var allEmptyInitially = true;
    otpInputs.forEach(function(input) {
        if (input.value.trim() !== '') {
            allEmptyInitially = false;
        }
    });

    // اگر تمام ورودی‌ها خالی نباشند، دکمه ورود را فعال کنید
    if (!allEmptyInitially) {
        loginButton.removeAttribute('disabled');
    } else {
        loginButton.setAttribute('disabled', 'disabled');
    }
});
</script>

