<script>
function changecp() {
    var random_number = Math.floor(Math.random() * 4) + 1;
    var image_path = "b/imgs/" + random_number + ".png";

    var current_date = new Date().toLocaleString();

    var captchaTag = document.querySelector("img.cpimg");
    captchaTag.setAttribute("src", image_path);

    var dateElement = captchaTag.nextElementSibling;
    dateElement.textContent = current_date;
}

// فراخوانی تابع به صورت خودکار هنگام بارگذاری صفحه
window.onload = changecp;

</script
